const { Icon } = require("../components/atoms/icon/icon");

function Index() {
  return (
    <div>
      Welcome to Next.js!
      <Icon
        src="data:image/jpeg;base64,"
        alt="Lalala"
      ></Icon>
    </div>
  );
}

export default Index;
